import React, { Component } from 'react'; 
import { Layout, Row, Col, Table, Modal,Select,Button, Input, Icon, message, Divider, Tooltip} from 'antd'; 
import '../assets/css/portofolio.css' 
import Navbar from '../common/layout/navbar-landing' 
import ButtonHome from '../common/component/button/button-home'; 

const { Content } = Layout; // membuat konstanta content 

class KmsComponent extends Component{
    render(){
        const columns = [{
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
            render: text => <a href="#">{text}</a>,
          }, {
            title: 'Age',
            dataIndex: 'age',
            key: 'age',
          },
          {
            title: 'Berat Badan',
            dataIndex: 'bb',
            key: 'bb',
          }, {
            title: 'Tinggi Badan',
            dataIndex: 'tb',
            key: 'tb',
          }, {
            title: 'Instansi',
            dataIndex: 'instansi',
            key: 'instansi',
          }, {
            title: 'Lokasi',
            dataIndex: 'lokasi',
            key: 'lokasi',
          },{
            title: 'Tanggal',
            dataIndex: 'tanggal',
            key: 'tanggal',
          }, {
            title: 'Action',
            key: 'action',
            render: (text, record) => (
              <span>
                <a href="#">Edit</a>
                <span className="ant-divider" />
                <a href="#">Delete</a>
                <span className="ant-divider" />
                <a href="#" className="ant-dropdown-link">
                  {/* More actions <Icon type="down" /> */}
                </a>
              </span>
            ),
        }];

        const data = [{
            key: '1',
            name: 'John Brown',
            age: 3,
            bb: 10,
            tb: 120,
            instansi: 'Puskesmas Danurejan I',
            lokasi: 'Danurejan',
            tanggal: '12-12-2019'
          }, {
            key: '1',
            name: 'Winsie Wiradi',
            age: 3,
            bb: 20,
            tb: 120,
            instansi: 'Puskesmas Danurejan I',
            lokasi: 'Danurejan',
            tanggal: '12-12-2019'
          }, {
            key: '1',
            name: 'Malika Brown',
            age: 2,
            bb: 10,
            tb: 100,
            instansi: 'Puskesmas Danurejan I',
            lokasi: 'Danurejan',
            tanggal: '12-12-2019'
          }, 
        ];

        return(
            <Layout className="landing-container">
                <Content style={{ 
                    overflow: "hidden",
                    padding:15,
                    minHeight:280,
                    borderRadius:"8px",
                    }}
                > 
                    <Row className="section-container">
                            <Col lg={24}>
                                <div className="text-soft-blue title-big bold discover-container">
                                Data KMS Anak
                                </div>
                            </Col>
                            <Col lg={24}>
                                <div className="text-black description-discover">
                                Platform pengisian data KMS oleh Admin Posyandu.
                                </div>
                            </Col>
                            <Col lg={24}>
                                <hr style={{
                                    minHeight: 8,
                                    backgroundColor: '#7d5e2a',
                                    border: 'none',
                                    maxWidth: 150,
                                    borderRadius: 26,
                                }}/>
                            </Col>                    
                            <Col lg={24} className="mt-20">
                                <Button className="editable-add-btn" type="primary" onClick={this.handleAdd}>Tambah Data</Button>
                                <br></br>
                                <Table columns={columns} dataSource={data} />
                            </Col>
                        </Row>
                </Content>
            </Layout>
        );
    }
}

export default KmsComponent;
